Diagnosis.
Funicle with segment 4 white (
Fig. 261
) and forewing with wide brown bands (
Fig. 260
).

Head with fine engraved reticulation, isodiametric on vertex and face medially, more elongate on face laterally, gena, and occiput; face laterally with 9 or 10 setae between subantennal grooves and preoccipital sutures and medially with 2 setae at lower level of toruli; vertex with 2 setae between hind ocelli and 2 well in front of them; occiput with 4 setae above foramen; gena with 15–20 setae. Antenna with length/width measurements (from 
holotype
) and number of longitudinal sensilla (in parentheses) as follows: scape 132/61, pedicel 77/38, funicle segments 1–6 175/28, 275/44 (1), 145/64 (1), 87/74 (2), 82/89 (2), 66/95 (2), entire clava 241/35 (6); the longitudinal sensilla short, only present in apical part of segment.

Wings. Fore wing measurements (from 
holotype
): length 1304, width 306, longest marginal setae 31, venation length 518; hind wing length 783, width 122, longest marginal setae 116, venation length 452.

